import React from "react";

const Buzzes = ({ buzz }) => {
  return (
    <div>
      <a class="block max-w-la p-6 bg-white border border-gray-200 rounded-lg shadow hover:bg-gray-100 dark:bg-gray-800 dark:border-gray-700 dark:hover:bg-gray-700">
        <h5 class="mb-2 text-2xl font-bold tracking-tight text-gray-900 dark:text-white">
          {buzz.name}
        </h5>
        <p class="font-normal text-gray-700 dark:text-gray-400">
          {buzz.message}
        </p>
      </a>
      <h4></h4>
      {/* <div></div>
      <div>{buzz.username}</div> */}
    </div>
  );
};

export default Buzzes;
